import React from 'react';
import { Box, Typography } from "module";
import { SkillData } from './SkillData';

const data = SkillData.map((item, index) => {
    return (<><Box my={2} key={index}>
        <Typography variant="h6">{item.title}</Typography>
        <div class="progress">
            <div className={item.classnames} style={{ width: item.width }}>{item.width}
            </div>
        </div>
    </Box></>)
})


const Skills = () => {
    return (
        <>
            {data}
        </>
    )
}

export default Skills;
